import { Table } from "antd";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { Tabs, Layout } from "antd";
import { Typography } from "antd";
import "./style.css";
const { Title } = Typography;
const { TabPane } = Tabs;
const { Content } = Layout;
function callback(key) {
  console.log(key);
}
const columns = [
  {
    title: "Mã Chi tiết HĐ",
    dataIndex: "MaCTHD",
    key: "MaCTHD",
  },
  {
    title: "Tên Sản Phẩm",
    dataIndex: "TenSP",
    key: "TenSP",
    render: (text) => <Link to="/nhaban/ctsp">{text}</Link>,
  },
  {
    title: "Số lượng",
    dataIndex: "SoLug",
    key: "SoLug",
  },
  {
    title: "Giá Tiền",
    dataIndex: "GiaTien",
    key: "GiaTien",
  },
];

const data = [
  {
    MaHD: "1",
    TinhTrang: "Đang giao",
    NgayLap: "14/07/2021",
    NgayGiao: "14/07/2021",
    PhiVC: "200000",
    TikiXu: "2000",
    TongTien: "100000",
    ThanhTien: "980000",
    GhiChu: "bdhfksdfhksdgioglagjeilgjaeoighaerlghae;",
  },
  {
    MaHD: "2",
    TinhTrang: "Đang giao",
    NgayLap: "14/07/2021",
    NgayGiao: "14/07/2021",
    PhiVC: "200000",
    TikiXu: "2000",
    TongTien: "100000",
    ThanhTien: "980000",
    GhiChu: "bdhfksdfhksd",
  },
  {
    MaHD: "3",
    TinhTrang: "Đang giao",
    NgayLap: "14/07/2021",
    NgayGiao: "14/07/2021",
    PhiVC: "200000",
    TikiXu: "2000",
    TongTien: "100000",
    ThanhTien: "980000",
    GhiChu: "bdhfksdfhksd",
  },
  {
    MaHD: "4",
    TinhTrang: "Đang giao",
    NgayLap: "14/07/2021",
    NgayGiao: "14/07/2021",
    PhiVC: "200000",
    TikiXu: "2000",
    TongTien: "100000",
    ThanhTien: "980000",
    GhiChu: "bdhfksdfhksd",
  },
];

function DsHoaDon() {
  return (
    <div>
      <Layout>
        <Content>
          <Title level={2} classname="titlename">
            Danh sách Chi Tiết Hóa Đơn
          </Title>

          <Table columns={columns} dataSource={data} />
        </Content>
      </Layout>
    </div>
  );
}

export default DsHoaDon;
